import './App.css';
import {useState,useEffect} from 'react'

function App() {

  const [articles,setArticles] = useState(["Article 1","Article 2","Article 3"])

  useEffect(()=>{
    fetch("http://127.0.0.1:8000/api/article/",{
      'method':'GET',
      headers:{
        'Content-Type':'application/json',
        'Authorization':'Token 505c0f4221b2e4844ef0161431402e144d47d6aa'
      }
    })
    .then(resp => resp.json())
    .then(resp => setArticles(resp))
    .catch(error => console.log(error))
  },[])

  return (
    <div className="App">
      <h1>Django - React Blog</h1>
      {articles.map(article => {
        return <h2>{article}</h2>
      })}
    </div>
  );
}

export default App;
